  false,\n\t\"url\": null,\n\t\"notes\": \"Glaciation of the Puget Sound region [Pleistocene
  Surface Deposits], Bulletin 8. The basin or depression of Pugel Sound in western
  Washington lies between the Olympic Mountains on the west and the Cascade Mountains
  on the east. In its northern Iorfion, it opens to the Pacific Ocean through the
  great valley occupied by the Strait of Juan de Fuca between the Olympic Mountains
  and Vancouver Island. The basin is enclosed on the south by a low divide between
  the Sound and the Chehalis River, the latter flowing to the Pacific south of the
  Olympics.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
